class Solution {
public:
    long long wonderfulSubstrings(string Word) {
    	long long count=0;
    	int WordLen=Word.size();
    	vector<int> StatusOfLetters(WordLen,0);//status of letters are represented in 10 bits,1 odd, 0 even
    	int initial=0;
        int i=0;
        int j=0;
        int NoOfOddLetters=0;
        while(j<WordLen){
            i=j;
            initial=0;
            while (i<WordLen){
                StatusOfLetters[i]=initial^(1<<(Word[i]-'a'));//here StatusOfLetters[i] is the status of letters for
                //the substring from j to i
                initial=StatusOfLetters[i];
                NoOfOddLetters=__builtin_popcount(initial);
                if(NoOfOddLetters<=1){
                    count++;
                }
                i=i+max(NoOfOddLetters-1,1);
            }
            j++;
        }
    	return count;

        
    }
};
int main(){
	Solution mysol;
	//string word="aba";
	//string word="aabb";
	//string word="he";
	string word="";
	cout<<mysol.wonderfulSubstrings(word)<<endl;
	
}